import React from 'react';
import Header from './components/Header/Header'
import Promo from './components/Promo/Promo'

function App() {
  return (
    <div className="App">
    <Header />
    <main>
      <div>Slider</div>
      <div>catergories</div>
      <div>Slider</div>
      <div>Video</div>
      <div>Join Us</div>
      <footer>Footer</footer>
    </main>
    </div>
  );
}

export default App;
